import axios from "axios";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

const URI = 'http://localhost:8000/libros';

const CompCreateLibro = () => {
    const [titulo, setTitulo] = useState('');
    const [autor, setAutor] = useState('');
    const [isbn, setIsbn] = useState('');
    const [categoria, setCategoria] = useState('');
    const [cantidad, setCantidad] = useState('');
    const [disponible, setDisponible] = useState(true);
    const [error, setError] = useState('');
    const navigate = useNavigate();

    // Procedimiento guardar
    const store = async (e) => {
        e.preventDefault();
        const token = localStorage.getItem("token"); 
        if (!titulo || !autor || !isbn || !categoria || !cantidad) {
            setError("Por favor, complete todos los campos.");
            return;
        }
        setError(''); // Limpiar mensaje de error
        try {
            await axios.post(URI, 
                {
                    titulo: titulo,
                    autor: autor,
                    isbn: isbn,
                    categoria: categoria,
                    cantidad: cantidad,
                    disponible: disponible
                },
                {
                    headers: {
                        "Authorization": `Bearer ${token}`
                    }
                }
            );
            navigate('/libros');
        } catch (error) {
            if (error.response) {
                console.error("Error de la solicitud:");
                console.error("Código de estado:", error.response.status);
                console.error("Datos de error:", error.response.data);
                console.error("Encabezados de respuesta:", error.response.headers);
                setError("Error al guardar el libro, intente nuevamente.");
            } else if (error.request) {
                console.error("La solicitud fue realizada, pero no se recibió respuesta");
                setError("No se recibió respuesta del servidor.");
            } else {
                console.error("Error en la configuración de la solicitud");
                setError("Error en la configuración de la solicitud.");
            }
        }
    };


    return (
        <div className="cont-create">
            <h1 className="text-center mb-4">Crear Libro</h1>
            {error && <div className="alert alert-danger">{error}</div>} {/* Mostrar error si existe */}
            <form onSubmit={store}>
                <div className="row">
                    <div className="col-md-6">
                        <div className="mb-3">
                            <label className="form-label">Título</label>
                            <input 
                                value={titulo}
                                onChange={(e) => setTitulo(e.target.value)} // Capturando el valor que se ingresa en el input
                                type="text"
                                className="form-control"
                                placeholder="Ingrese el título del libro"
                            />
                        </div>
                    </div>

                    <div className="col-md-6">
                        <div className="mb-3">
                            <label className="form-label">Autor</label>
                            <input 
                                value={autor}
                                onChange={(e) => setAutor(e.target.value)} 
                                type="text"
                                className="form-control"
                                placeholder="Ingrese el autor del libro"
                            />
                        </div>
                    </div>
                </div>

                <div className="row">
                    <div className="col-md-6">
                        <div className="mb-3">
                            <label className="form-label">ISBN</label>
                            <input 
                                value={isbn}
                                onChange={(e) => setIsbn(e.target.value)} 
                                type="number"
                                className="form-control"
                                placeholder="Ingrese el ISBN"
                            />
                        </div>
                    </div>

                    <div className="col-md-6">
                        <div className="mb-3">
                            <label className="form-label">Categoría</label>
                            <input 
                                value={categoria}
                                onChange={(e) => setCategoria(e.target.value)} 
                                type="text"
                                className="form-control"
                                placeholder="Ingrese la categoría del libro"
                            />
                        </div>
                    </div>
                </div>

                <div className="row">
                    <div className="col-md-6">
                        <div className="mb-3">
                            <label className="form-label">Cantidad</label>
                            <input 
                                value={cantidad}
                                onChange={(e) => setCantidad(e.target.value)} 
                                type="number"
                                className="form-control"
                                placeholder="Cantidad disponible"
                            />
                        </div>
                    </div>

                    <div className="col-md-6">
                        <div className="mb-3">
                            <label className="form-label">Disponible</label>
                            <input
                                type="checkbox"
                                checked={disponible}
                                onChange={() => setDisponible(!disponible)}
                            />
                        </div>
                    </div>
                </div>

                <div className="text-center">
                    <button type="submit" className="btn btn-primary">Guardar</button>
                </div>
            </form>
        </div>
    );
};

export default CompCreateLibro;
